import React from 'react';
import logo from './logo.svg';
import * as firebase from 'firebase';
import './App.css';
import './Register.css';


let dbmydata;
let database;
let username;
let userpassword;

class Register extends React.Component {
constructor(props) {
    super(props);

    this.onSubmit = this.onSubmit.bind(this);
}
onSubmit(e) {
    username = document.getElementById('user-name').value;
    userpassword = document.getElementById('user-password').value;
    var complainData={
        username:username,
        password:userpassword 
    }
    database = firebase.database();
    dbmydata = database.ref("/");
    console.log("MY DB Data :: " , dbmydata);
    dbmydata.push(complainData).then((val) => {
        console.log("val",val);
        console.log("Sccess data");
    });

    // alert(username + " Comeon  " + userpassword);

}

handleSubmit = (event) => {
    event.preventDefault();
    const { email, password } = this.state;
    firebase
        .auth()
        .signInWithEmailAndPassword(email, password)
        .then((user) => {
            this.props.history.push('/');
        })
        .catch((error) => {
            this.setState({ error: error });
    });
};

  render () {
    const { email, password, error } = this.state;
    return (
        <Container>
            <Flex>
                <Box>
                    <Subhead>Log In</Subhead>
                </Box>
            </Flex>
            {error ? (
                <Flex>
                    <Box>
                        <Text>{error.message}</Text>
                    </Box>
                </Flex>
            ) : null}
            <Flex>
                <Box>
                <form onSubmit={this.handleSubmit}>
                    <Input type="text" name="email" placeholder="Email" value={email} onChange={this.handleInputChange} />
                    <Input
                    type="password"
                    name="password"
                    placeholder="Password"
                    value={password}
                    onChange={this.handleInputChange}
                    />
                    <Button children="Log In" />
                </form>
                </Box>
            </Flex>
        </Container>
    );
  }
}

export default Register;
